import React from 'react';
import '../Styles/Header.css';
// Hugo will do header and footer. That will include hamburger menu and modal for social media links

const Header = () => {
    return (
        <>
    <header>
        <nav>
            <ul>
                <li> Hot dog menu </li>
                </ul>
                </nav>
                </header>
        </>
    )
}
export default Header;
